const History = ({ histories, onSelectHistory }) => {
  return (
    <div>
      {histories.map((history, index) => {
        let text = `Move ${index}`;
        if (index === 0) text = "Start Game";
        return (
          <button onClick={() => onSelectHistory(histories[index])}>
            {text}
          </button>
        );
      })}
    </div>
  );
};

export default History;
